【THE FRED STUBBLEの特徴】<br>TONBI社 × THUNDERBOLT TECHNOLOGIES<br>トンビ社がサンダーボルトテクノロジーを駆使しリリースした<br>マジックボードその名もFRED STUBBLE（フレッドスタブル）<br>コナーコフィンのマジックボードとしてリクエストしたのがこのフレッドスタブル。<br>前作のフレッドラブルよりも短めで幅をもたせたスモールウェーブ用にデザインされ特徴は<br>ワイドなノーズとテールデザイン、そしてロッカーを抑た。<br>シングルコンケーブに沢山のダブルコンケーブをフィンエリアまで入れ<br>最後はVeeで抜いたボトムデザイン。<br>レイルもフレッドラブルよりも薄くしたがセンターボリュームはキープ。<br>パワーのない波やサイズの小さい波でもドライブしながら抜けタイトなカーブを<br>可能にした操作性抜群のボードに進化。<br>通常の板より3インチ長い板の様な素早いテイクオフを可能にした。<br>まさにあなたのマジックボードとなるでしょう。<br><br>【THUNDERBOLT TECHNOLOGIESの特徴】<br>サーフボードの素材であるEPSフォームにモールド成型を使ったPVC（ポリ塩化ビニル）を<br>薄く圧着させることでボードにねばりをもたせ従来のEPS特有の縦方向にきくフレックスに加え<br>横や斜め方向への「ねじれ」を実現。そのねじれによってしなやかで伸びのあるライディングが可能になった。<br>さらにPVCは常にEPSフォームからの内圧を受ける為、結果的にフレックスの良さと強度が向上し<br>さらに軽量化にも成功。<br>・フレックス、強度、ねじれ、は今までに無い最高峰のボードとしてプロデュース。<br><br>■レベル■<br>・初級～上級などレベル関係無く全てのサーファーにおススメ<br>・スネ～アタマサイズでオールラウンドで使用できます。<br><br>■素材■<br>EPS<br>XEONFIBER　CARBON<br><br>■サイズ■<br>【長さ】172.7cm(5'8)<br>【幅】48.26cm(19)<br>【厚さ】6.0cm(2 3/8)<br>【CL値】27.2cl<br><br>【長さ】177.8cm(5'10)<br>【幅】48.9cm(19 1/4)<br>【厚さ】6.3cm(2 1/2)<br>【CL値】29.9cl<br><br>【長さ】182.9cm(6'0)<br>【幅】49.8cm(19 5/8)<br>【厚さ】6.6cm(2 5/8)<br>【CL値】32.9cl<br><br>■付属品■<br>保証書、Gore-texプラグ説明書、CIリーシュストリング<br><br>※フィンは付属しません。<br>※FCS2対応のフィンBOXの為、旧FCSも取付可能ですがFCS2を<br>強く推奨します。<br>※「旧FCSフィン」をご使用される場合はその旨を事前に<br>ご理解お願いいたします。<br>※商品到着後必ず保証書、Gore-texプラグ説明書の内容をご確認ください。<br><br><img src="https://image.rakuten.co.jp/murasaki-sports/cabinet/bana/information_600-600.gif"><br><br>メーカー希望小売価格はメーカー商品タグに基づいて掲載しています<br><img src="https://image.rakuten.co.jp/murasaki-sports/cabinet/16-h/evidence_fredstubb.jpg" width="300px"><!--
